State moves to delete the penalty enhancer on count 1.   Motion granted.   
Count 1 - Bail Jumping - No contest plea.   Convicted.   State moves to dismiss and read in count 2, obstruct officer as repeater.   Court grants the motion.   
Sentence is withheld.   Defendant is placed on probation to DOC for two (2) years.   Conditions of probation are:  
1) Assessment/treatment/counseling as deemed appropriate by the Department's assessment process; 
2) Maintain absolute sobriety; 
3) Submit to random urine screens and pay for same; 
4) Maintain full-time employment/schooling combination; 
5) Sixty (60) days jail imposed and stayed, to be imposed upon the discretion of the agent and upon order of the court; 
6) Pay costs of action; 
7) Pay supervision fees in an amount to be determined by DOC; 
8) Submit DNA sample.   
Defendant has 91 days sentence credit.  
Minutes.
